     */
    let command = `${action.slice(0, 1).toLowerCase()}${action.slice(1)}Alert`;

    /**
     * Alert boxes can't be dismissed, this causes Chrome to crash during tests
     */
    if (modalType === 'alertbox') {
        command = 'acceptAlert';
    }

    browser[command]();
};

